import { SET_HORARIO } from "actions/types";
const initialState = {
  horario: { cd_prestadora: 0, nombre: "" },
};

export default function (state = initialState, action) {
  switch (action.type) {
    case SET_HORARIO:
      return {
        ...state,
        horario: action.payload,
      };

    default:
      return state;
  }
}
